export default class Offerings extends React.Component {
  render() {
    return (
      <section
        className="section section--light section--offerings"
        id="nabidka"
      >
        <div className="section__content">
          <div className="container">
            <h1>Nabídka</h1>
            <div className="divider-horizontal" />
            <ul>
              {offeringsData.map((offering, index) => {
                return (
                  <li
                    key={index}
                    onClick={() =>
                      this.props.modalHandler("modalOffering", { offering })
                    }
                  >
                    <div className="offering-avatar">{offering.avatar}</div>
                    <h3>{offering.title}</h3>
                  </li>
                );
              })}
            </ul>
            <a className="btn" href="#o-nas">
              Chci vědět více
            </a>
          </div>
        </div>
        <div className="divider-vertical" />
      </section>
    );
  }
}
